import React from 'react';

const Bookmark = () => {
  return (
    <button
      type="button"
      className="group inline-flex items-center rounded-lg p-2.5 text-dark hover:bg-orange-100 dark:text-stone-100 dark:hover:bg-stone-700 focus:outline-none focus-visible:outline-none focus-visible:ring-1 focus-visible:ring-secondary"
      data-bookmark-button="bookmark-button"
    >
<img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSUnY3n0swXwI9VI6AIZCITGxeoSTPg7ZKNKw&s'></img>   
 </button>
  );
};

export default Bookmark;
